import './App.css';
import Navbar from './Components/Navbar';


function App() {
  return (
    <div className="App">
   <Navbar/>
   <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/services" element={<Services/>} />
          <Route path="/about" element={<About />} />
        </Routes>
    </div>
  );
}

export default App;
